[{"location":"#ARCEMEAnalysis","page":"Home","title":"ARCEMEAnalysis","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for ARCEMEAnalysis.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"#ARCEMEAnalysis.Event","page":"Home","title":"ARCEMEAnalysis.Event","text":"struct Event\n\nDefine a structure to hold information about an ARCEME event.\n\n\n\n\n\n","category":"type"},{"location":"#ARCEMEAnalysis._arceme_cubenames-Tuple{}","page":"Home","title":"ARCEMEAnalysis._arceme_cubenames","text":"_arceme_cubenames(;batch=\"SECONDBATCH\")\n\nList all available data cube names in the specified batch stored in the ARCEME S3 bucket.\n\n\n\n\n\n","category":"method"},{"location":"#ARCEMEAnalysis.arceme_all_footprints-Tuple{Any, Any}","page":"Home","title":"ARCEMEAnalysis.arceme_all_footprints","text":"arceme_all_footprints(ds_d, ds_dhp)\n\nComputes both optical and radar footprints for the ARCEME data cube datasets ds_d and ds_dhp. Also aggregates the footprints over time in 2-monthly windows for the whol 2 years around the event date.\n\n\n\n\n\n","category":"method"},{"location":"#ARCEMEAnalysis.arceme_bias_corrected_fp","page":"Home","title":"ARCEMEAnalysis.arceme_bias_corrected_fp","text":"arceme_bias_corrected_fp(inputcube,cloudcube,lccube)\n\nComputes a cloud-biased corrected footprint aggregated by land cover class for the  provided inputcube, cloud mask and land cover cube. \n\n\n\n\n\n","category":"function"},{"location":"#ARCEMEAnalysis.arceme_coordinates-Tuple{Any}","page":"Home","title":"ARCEMEAnalysis.arceme_coordinates","text":"arceme_coordinates(ds)\n\nGet the longitude and latitude coordinates of the center of the ARCEME data cube dataset ds.\n\n\n\n\n\n","category":"method"},{"location":"#ARCEMEAnalysis.arceme_endtime-Tuple{Any}","page":"Home","title":"ARCEMEAnalysis.arceme_endtime","text":"arceme_endtime(ds)\n\nGet the end time of the ARCEME data cube dataset ds\n\n\n\n\n\n","category":"method"},{"location":"#ARCEMEAnalysis.arceme_eventdate-Tuple{Any}","page":"Home","title":"ARCEMEAnalysis.arceme_eventdate","text":"arceme_eventdate(ds)\n\nGet the time of when the event in an ARCEME data cube dataset ds happened.\n\n\n\n\n\n","category":"method"},{"location":"#ARCEMEAnalysis.arceme_eventlist-Tuple{}","page":"Home","title":"ARCEMEAnalysis.arceme_eventlist","text":"arceme_eventlist()\n\nGet a list of ARCEME events from the local CSV file.\n\n\n\n\n\n","category":"method"},{"location":"#ARCEMEAnalysis.arceme_eventpairs-Tuple{}","page":"Home","title":"ARCEMEAnalysis.arceme_eventpairs","text":"arceme_eventpairs()\n\nGet pairs of ARCEME events from the event list.\n\n\n\n\n\n","category":"method"},{"location":"#ARCEMEAnalysis.arceme_landcover-Tuple{Any}","page":"Home","title":"ARCEMEAnalysis.arceme_landcover","text":" arceme_landcover(ds)\n\nGet the land cover statistics for the ARCEME data cube dataset ds.\n\n\n\n\n\n","category":"method"},{"location":"#ARCEMEAnalysis.arceme_merge_footprints-Tuple{Any, Any}","page":"Home","title":"ARCEMEAnalysis.arceme_merge_footprints","text":"arceme_merge_footprints(optical_fp, radar_fp)\n\nMerges the optical and radar footprints datasets into a single dataset.\n\n\n\n\n\n","category":"method"},{"location":"#ARCEMEAnalysis.arceme_ndvi-Tuple{Any}","page":"Home","title":"ARCEMEAnalysis.arceme_ndvi","text":"arceme_ndvi(ds)\n\nCompute the NDVI (Normalized Difference Vegetation Index) for the ARCEME data cube dataset ds.\n\n\n\n\n\n","category":"method"},{"location":"#ARCEMEAnalysis.arceme_open-Tuple{Any}","page":"Home","title":"ARCEMEAnalysis.arceme_open","text":"arceme_open(cubename; batch=\"SECONDBATCH\")\n\nOpen the specified ARCEME data cube from the S3 bucket.\n\n\n\n\n\n","category":"method"},{"location":"#ARCEMEAnalysis.arceme_optical_band_footprints-Tuple{Any, Any}","page":"Home","title":"ARCEMEAnalysis.arceme_optical_band_footprints","text":"arceme_optical_band_footprints(ds_d, ds_dhp)\n\nComputes footprints for all optical bands in the ARCEME data cube datasets ds_d and ds_dhp.  Also aggregates the footprints over time in 2-monthly windows for the whol 2 years around the event date.\n\n\n\n\n\n","category":"method"},{"location":"#ARCEMEAnalysis.arceme_radar_footprints-Tuple{Any, Any}","page":"Home","title":"ARCEMEAnalysis.arceme_radar_footprints","text":"arceme_radar_footprints(ds_d, ds_dhp)\n\nComputes footprints for all radar bands in the ARCEME data cube datasets ds_d and ds_dhp. Also aggregates the footprints over time in 2-monthly windows for the whol 2 years around the event date.\n\n\n\n\n\n","category":"method"},{"location":"#ARCEMEAnalysis.arceme_rgb-Tuple{Any}","page":"Home","title":"ARCEMEAnalysis.arceme_rgb","text":"arceme_rgb(ds)\n\nCompute the RGB composite for the ARCEME data cube dataset ds.\n\n\n\n\n\n","category":"method"},{"location":"#ARCEMEAnalysis.arceme_starttime-Tuple{Any}","page":"Home","title":"ARCEMEAnalysis.arceme_starttime","text":"arceme_starttime(ds)\n\nGet the start time of the ARCEME data cube dataset ds\n\n\n\n\n\n","category":"method"},{"location":"#ARCEMEAnalysis.arceme_uncorrected_fp-Tuple{Any, Any}","page":"Home","title":"ARCEMEAnalysis.arceme_uncorrected_fp","text":"arceme_uncorrected_fp(inputcube,dataset; timeaxis=:time_sentinel_1_rtc)\n\nComputes a cloud-biased corrected footprint aggregated by land cover class for the  provided inputcube, cloud mask and land cover cube. \n\n\n\n\n\n","category":"method"}]
